import React, {Component} from 'react';
import { Container, Row, Col } from 'reactstrap';

class AboutMe extends Component {
  render(){
    return (
      <div>
      <Hero title={"Resume"} />
      <Container className="about-body">
        <Row>
            <Col align='center'>
              <h1>Let's know each other</h1>
            </Col>
          </Row>
      </Container>
      </div>
    );
  }
}

export default AboutMe;
